  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:19.321490\",\n\t\"name\": \"field-studies-at-cape-peirce-alaska-1976-annual-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Colonies of Double-crested Cormorants (Phalacrocorax
  auritus), Pelagic Cormorants (P. pelagicus), Glaucous-winged Gulls (Larus glaucescens),
  Black-legged Kittiwakes (Rissa tridactyla), Common Murres (Uria aalge), and Tufted
  Puffins (Lunda cirrhata) were studied from 28 April to 9 September 1976. Abundance,
  distribution, breeding status, reproductive success, and factors influencing that
  success were determined for each species. General distribution of colonies in 1976
  was the same as found by previous observers for all species except Pelagic Cormorants
  which shifted breeding areas. All suitable nesting areas were occupied by species
  for which the habitat appeared most appropriate. Although data from previous studies
  was not adequate to permit direct comparison of nesting densities, populations seemed
  to be similar to other years.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
